import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let myFont = new FontFace(
  "Mina",
  "url(https://fonts.googleapis.com/css2?family=Mina:wght@700&display=swap)"
);

myFont.load()

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

